-- data base set up 

CREATE TABLE Transactions(
	tx_id integer PRIMARY KEY, 
	block_id integer NOT NULL
); 

CREATE TABLE Outputs(
	output_id integer PRIMARY KEY, 
	tx_id integer NOT NULL REFERENCES Transactions ON DELETE CASCADE, 
	pk_id integer NOT NULL,
	value bigint NOT NULL
);

CREATE TABLE Inputs( 
	input_id integer PRIMARY KEY, 
	tx_id integer NOT NULL REFERENCES Transactions ON DELETE CASCADE, 
	sig_id integer NOT NULL, 
	output_id integer NOT NULL,
	CHECK (((NOT sig_id = 0) OR output_id = -1) AND ((NOT output_id = -1) OR sig_id = 0)) -- ensures that sig_id and output_id are consistent with respect to the indication of coinbase transactions 
); 


-- infrastructure for clustering 

CREATE TABLE addressRelations (addr1 int, addr2 int); 

CREATE FUNCTION clusterAddresses ()
RETURNS TABLE (id int, address int)
AS $$
DECLARE cluster_loop int; 
DECLARE curr_addr int; 
BEGIN
	CREATE TEMP TABLE closure (addr1 int, addr2 int) ON COMMIT DROP; 
	SELECT * FROM addressRelations; 
	SELECT X.addr1, X.addr2 
	 FROM 
	((SELECT addr1, addr1 FROM closure AS F1
	UNION 
	SELECT addr2, addr2 FROM closure AS F2)
	EXCEPT 
	SELECT addr1, addr2 FROM closure AS F3)
	AS X (addr1, addr2);
	SELECT X.addr1, X.addr2 
	FROM 
	(
	(SELECT F1.addr2, F1.addr1 
	FROM closure AS F1
	WHERE F1.addr1 <> F1.addr2) 
	EXCEPT 
	(SELECT F2.addr1, F2.addr2 FROM closure AS F2) 
	) AS X (addr1, addr2); -- building transitive closure 
	SELECT X.addr1, X.addr2 
	FROM 
	((SELECT F1.addr1, F2.addr2 
	FROM closure AS F1, closure AS F2
	WHERE F1.addr2 = F2.addr1) 
	EXCEPT 
	(SELECT F3.addr1, F3.addr2 FROM closure AS F3) 
	) AS X (addr1, addr2);
	CREATE TEMP TABLE cliques (id int, addr int) ON COMMIT DROP; -- temporary table for cliques 
	SELECT addr AS id, addr 
	FROM (	SELECT DISTINCT *
			FROM 
				(SELECT DISTINCT addr1 AS addr
				FROM addressRelations) AS A
				UNION 
				(SELECT DISTINCT addr2 AS addr 
				FROM addressRelations)
		) AS C
	;
	CREATE TEMP TABLE IterationSet (iter_id int) ON COMMIT DROP; -- set of cluster ids that sill need to be itereated through
		SELECT cliques.id FROM cliques; 
	WHILE ((SELECT count(*) FROM IterationSet) > 0) LOOP
		SELECT iter_id INTO cluster_loop -- select maximal address from the IterationSet 
		FROM IterationSet
		WHERE iter_id = (SELECT max(iter_id) FROM IterationSet); 
		SELECT addr INTO curr_addr  -- select witness address from clique
		FROM cliques WHERE cliques.id = cluster_loop; 
		DELETE FROM IterationSet -- deletes from iteration set the ids of the address that get unified
		WHERE iter_id IN (SELECT cliques.id FROM cliques WHERE addr IN (SELECT addr2 FROM closure WHERE addr1 = curr_addr)); 
		UPDATE cliques -- unifies the ids of the addresses in the same clique than curr_addr 
			SET id = (SELECT cliques.id FROM cliques WHERE addr = curr_addr) -- should actually be just iter_id, right?
		WHERE addr IN (SELECT addr2 FROM closure WHERE addr1 = curr_addr); 
	END LOOP; 
RETURN QUERY (SELECT * FROM cliques); 
END;
$$ LANGUAGE plpgsql; 

